import Link from "next/link";

const Logo = () => (
  <>
    <Link href="/">
      <a className="logo">Woo Young Choi</a>
    </Link>
    <style jsx>
      {`
        .logo {
          display: block;
          margin-top: 10px;
          padding-bottom: 5px;
          text-decoration: none;
          float: left;
          font-family: "futura";
          font-size: 20px;
          font-weight: bold;
          color: #00ace6;
        }
      `}
    </style>
  </>
);

const Header = () => (
  <>
    <div className="navbar">
      <Logo />
      <div className="wrapper">
        <Link href="/">
          <a className="navlink">Home</a>
        </Link>
        <Link href="/about">
          <a className="navlink">About</a>
        </Link>
      </div>
    </div>
    <style jsx>
      {`
        .navbar {
          display: inline-block;
          width: 100%;
        }

        .wrapper {
          display: inline-block;
          padding-left: 50px;
        }

        .navlink {
          display: inline-block;
          color: #00ace6;
          font-family: "Arial";
          margin: 5px;
          padding: 10px;
          text-decoration: none;
          box-shadow: 3px 3px 10px 0.5px #ddd;
        }

        .navlink:hover {
          opacity: 0.6;
        }
      `}
    </style>
  </>
);

export default Header;
